import { Row } from "react-bootstrap";
import ProdactCard from '../../components/Prodact/ProdactCard'


function ProdactCardContiner() {
    return (
     <Container >
        <Subtitle title="الاكثر مبيعا" btntitle="المزيد"/>
        <Row>
          <ProdactCard/>
          <ProdactCard/>
          <ProdactCard/>
          <ProdactCard/>
          <ProdactCard/>
          <ProdactCard/>
        </Row>
     </Container>
    );
  }
  
  export default ProdactCardContiner;
